import { runGetApi, runPostApi } from "../api";

export async function LoginApi(data) {
    const result = await runPostApi("api/token/", data);
    return result;
}

export async function LoginUserApi(data) {
    const res = await runGetApi("api/user/", data);
    return res;
}
